import { BrowserRouter } from "react-router-dom"
import { Routing } from "./Routing"
import './style.css'
import { useEffect } from "react"
import { getCarModels } from "../ApiRequests/CarModel"
import { useDispatch } from "react-redux"
import { setCarModels, setCarTypes } from "../redux/Actions"
import { getCarTypes } from "../ApiRequests/CarTypes"
import { getDriveTypes } from "../ApiRequests/DriveTypes"

export const Main = () => {

    let dis = useDispatch()

    useEffect(() => {
        getCarModels()
            .then(x => {
                dis(setCarModels(x.data))
            })
            .catch(error => {
                console.log(error.message);
            })


        getCarTypes()
            .then(x => {
                dis(setCarTypes(x.data))
            })
            .catch(error => {
                console.log(error.message);
            })

        getDriveTypes()
            .then(x => {
                dis(setd(x.data))
            })
            .catch(error => {
                console.log(error.message);
            })
    }, [])

    if (!sessionStorage.getItem("isFirstLogin")) {
        sessionStorage.setItem("currentUser", JSON.stringify(null))
        sessionStorage.setItem("isFirstLogin", true)
    }

    return <>
        <BrowserRouter>
            <Routing></Routing>
        </BrowserRouter>
    </>
}
